import React from "react"
import Funcionario from './Funcionario'

const ListaFuncionarios = () => {
    let listFuncionario = [
        { id: 1, nome: "funcionario 1", sobrenome: "silva", email: "funcionario1@empersa.com", numeroNIS: 1111 },
        { id: 2, nome: "funcionario 2", sobrenome: "d", email: "funcionario2@empersa.com", numeroNIS: 2222 },
        { id: 3, nome: "funcionario 3", sobrenome: "a", email: "funcionario3@empersa.com", numeroNIS: 3333 },
        { id: 4, nome: "funcionario 4", sobrenome: "x", email: "funcionario7@empersa.com", numeroNIS: 4444 }
    ];

    function novoFuncionario(evt) {
        <Funcionario id={null} />
    }

    function loadFuncionario(evt) {
        alert(evt.target.id);
        <Funcionario id={evt.target.id} />
    }

    function deletaFuncionario(evt) {
        alert(evt.target.id);
    }

    function getListaFuncionarios() {
        return listFuncionario.map( funcionario => {
            return <tr id={funcionario.id} onClick={loadFuncionario}>
                <td>{funcionario.id}</td>
                <td>funcionario.nome</td>
                <td>funcionario.sobrenome</td>
                <td><input id={funcionario.id} type="button" value="X" onClick={deletaFuncionario} /></td>
            </tr>
            //  key={funcionario.id} id={funcionario.id} onClick={loadFuncionario}>
            //     {funcionario.id} - {funcionario.nome} - {funcionario.sobrenome} - <input type="button" value="X" onClick={deletaFuncionario} />
            // </li>
        })
    }

    return (
        <div>
            <h1>Funcion√°rios</h1>
            <input type="button" value="Novo" onClick={novoFuncionario} />
            <table heigth='40%'>
                <thead>
                    <td>ID</td>
                    <td>Nome</td>
                    <td>Sobrenome</td>
                </thead>
                <tbody overflow="auto">
                    {getListaFuncionarios()}
                </tbody>
            </table>
        </div>
    )
}
export default ListaFuncionarios;
